import React, { useState } from "react";

const RegistrationForm = () => {
  const [values, setValues] = useState({
    username: "",
    email: "",
    password: "",
    confirmPassword: "",
    profilePicture: null,
  });

  const [errors, setErrors] = useState({});

  const handleChange = (event) => {
    const { name, value } = event.target;
    setValues({ ...values, [name]: value });
  };

  const handleFileChange = (event) => {
    const file = event.target.files[0];
    setValues({ ...values, profilePicture: file });
  };

  const handleSubmit = (event) => {
    event.preventDefault();

    const validationErrors = validate(values);
    if (Object.keys(validationErrors).length > 0) {
      setErrors(validationErrors);
    } else {
      setErrors({});
      console.log("Submitting form", values);
      // Make an API call or submit the form data to a server here
    }
  };

  const validate = (values) => {
    const errors = {};

    if (!values.username.match(/^[A-Za-z0-9]{3,16}$/)) {
      errors.username =
        "Username should be 3-16 characters and shouldn't include any special character!";
    }

    if (!values.email.match(/^[a-z0-9](.?[a-z0-9]){5,}@g(oogle)?mail.com$/)) {
      errors.email = "It should be a valid email address!";
    }

    if (
      !values.password.match(
        /^(?=.*[0-9])(?=.*[a-zA-Z])(?=.*[!@#$%^&*])[a-zA-Z0-9!@#$%^&*]{8,20}$/
      )
    ) {
      errors.password =
        "Password should be 8-20 characters and include at least 1 letter, 1 number and 1 special character!";
    }

    if (values.password !== values.confirmPassword) {
      errors.confirmPassword = "Passwords don't match!";
    }

    if (
      values.profilePicture &&
      !["image/jpeg", "image/png"].includes(values.profilePicture.type)
    ) {
      errors.profilePicture = "Not supported!";
    }

    return errors;
  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label htmlFor="username">{values.label}</label>
        <input
          type={values.type}
          id={values.id}
          name="username"
          placeholder={values.placeholder}
          value={values.username}
          onChange={handleChange}
          required={values.required}
          pattern={values.pattern}
        />
        {errors.username && <p>{errors.username}</p>}
      </div>

      <div>
        <label htmlFor="email">{values.label}</label>
        <input
          type={values.type}
          id={values.id}
          name="email"
          placeholder={values.placeholder}
          value={values.email}
          onChange={handleChange}
          required={values.required}
          pattern={values.pattern}
        />
        {errors.email && <p>{errors.email}</p>}
      </div>

      <div>
        <label htmlFor="password">{values.label}</label>
        <input
          type={values.type}
          id={values.id}
          name="password"
          placeholder={values.placeholder}
          value={values.password}
          onChange={handleChange}
          required={values.required}
          pattern={values.pattern}
        />
        {errors.password && <p>{errors.password}</p>}
      </div>

      <div>
        <label htmlFor="confirmPassword">{values.label}</label>
        <input
          type={values.type}
          id={values.id}
          name="confirmPassword"
          placeholder={values.placeholder}
          value={values.confirmPassword}
          onChange={handleChange}
          required={values.required}
          pattern={values.pattern}
        />
        {errors.confirmPassword && <p>{errors.confirmPassword}</p>}
      </div>

      <div>
        <label htmlFor="profilePicture">{values.label}</label>
        <input
          type={values.type}
          id={values.id}
          name="profilePicture"
          placeholder={values.placeholder}
          onChange={handleFileChange}
          required={values.required}
          accept=".jpg,.png"
        />
        {errors.profilePicture && <p>{errors.profilePicture}</p>}
      </div>

      <button type="submit">Submit</button>
    </form>
  );
};

export default RegistrationForm;
